
create table categorias(
cat_id integer AUTO_INCREMENT PRIMARY KEY,
cat_nombre varchar(30)
);

create table proveedores(
pro_id integer AUTO_INCREMENT PRIMARY KEY,
pro_nombre varchar(60) NOT NULL UNIQUE,
pro_direccion varchar(70) NOT NULL,
pro_celular varchar(30) NOT NULL,
pro_representante varchar(60) NOT NULL
);

create table productos(
prod_id integer AUTO_INCREMENT PRIMARY KEY,
prod_nombre varchar(40) NOT NULL,
prod_existencias smallint,
prod_precio numeric(10) NOT NULL,
prod_cat_id integer,
prod_pro_id integer
);

ALTER TABLE productos ADD CONSTRAINT fk_prod_cat_id FOREIGN KEY (prod_cat_id) REFERENCES categorias(cat_id);
ALTER TABLE productos ADD CONSTRAINT fk_prod_pro_id FOREIGN KEY (prod_pro_id) REFERENCES proveedores(pro_id);


create table clientes( 
cli_cedula varchar(10),
cli_nombre varchar(40) NOT NULL,
cli_direccion varchar(70) NOT NULL,
cli_ciudad varchar(15),
cli_telefono varchar(30),
CONSTRAINT pk_cli_cedula PRIMARY KEY (cli_cedula),
CONSTRAINT ck_cli_ciudad CHECK (cli_ciudad IN ('BUCARAMANGA','GIRON','PIEDECUESTA','FLORIDABLANCA','LEBRIJA'))
);


create table empleados(
emp_cedula integer,
emp_nombres varchar(40) NOT NULL,
emp_apellidos varchar(40) NOT NULL,
emp_fecha_nac date NOT NULL,
cli_direccion varchar(70) NOT NULL,
cli_telefono varchar(30) NOT NULL,
CONSTRAINT pk_emp_cedula PRIMARY KEY (emp_cedula)
);


create table pedidos(
ped_id integer,
ped_fechapedido date NOT NULL,
ped_fechaentrega date,
ped_cli_cedula varchar(10),
ped_emp_cedula integer,
CONSTRAINT pk_ped_id PRIMARY KEY(ped_id),
CONSTRAINT fk_ped_cli_cedula FOREIGN KEY (ped_cli_cedula) REFERENCES clientes(cli_cedula),
CONSTRAINT fk_ped_emp_cedula FOREIGN KEY (ped_emp_cedula) REFERENCES empleados(emp_cedula)
);

create table detalle_pedidos(
det_ped_id integer,
det_prod_id integer,
det_cantidad smallint,
det_descuento numeric(3),
CONSTRAINT fk_det_ped_id  FOREIGN KEY (det_ped_id) REFERENCES pedidos(ped_id),
CONSTRAINT fk_det_prod_id FOREIGN KEY (det_prod_id) REFERENCES productos(prod_id)
);








